INSERT INTO `fpr_fpcommand` VALUES (3,NULL,0,'2013-11-15 01:18:36','6537147f-4dd4-4950-8aff-5578db9a485d','c5465b07-8dc7-475e-a5c9-ccb2ba2ed083','FITS','This is a placeholder command only, and should not be called.','as_is','','d60e5243-692e-4af7-90cd-40c53cb8dc7d','characterization',NULL,NULL),(4,NULL,1,'2013-11-15 01:18:36','ef3ea000-0c3c-4cae-adc2-aa2a6ccbffce','12e11ac5-d96d-412f-ab15-362ed5283d46','Standard verification command (file exists only)','test -f \"%outputLocation%\"','bashScript','',NULL,'verification',NULL,NULL),(5,NULL,1,'2013-11-15 01:18:36','a9111dc0-edc9-47f8-85e5-ad4013971361','12e11ac5-d96d-412f-ab15-362ed5283d46','Standard verification command (non zero filesize)','test -s \"%outputLocation%\"','bashScript','',NULL,'verification',NULL,NULL),(6,NULL,1,'2013-11-15 01:18:36','0fd7935a-ed0d-4f67-aa25-1b44684f6aca','2385486a-35e2-42e4-bae9-3bfa1995dda4','convert event detail','echo program=\\\"convert\\\"\\; version=\\\"`convert -version | grep Version:`\\\"','bashScript','',NULL,'event_detail',NULL,NULL),(7,NULL,1,'2013-11-15 01:18:36','1db2deea-01dd-43e5-9f27-dc9ed02acdfe','06523365-9061-4ac7-a7f5-3e7e5f06ffac','inkscape event detail','echo program=\\\"inkscape\\\"\\; version=\\\"`inkscape -V`\\\" ','bashScript','',NULL,'event_detail',NULL,NULL),(8,NULL,1,'2013-11-15 01:18:36','42e7fdc3-42c6-4715-b79a-e900df916cab','2385486a-35e2-42e4-bae9-3bfa1995dda4','readpst event detail','echo program=\\\"readpst\\\"\\; version=\\\"`readpst -V`\\\"','bashScript','',NULL,'event_detail',NULL,NULL),(9,NULL,1,'2013-11-15 01:18:36','45a2f264-37d7-4881-b28c-25d628bf2823','2385486a-35e2-42e4-bae9-3bfa1995dda4','Ghostscript event detail','echo program=\\\"Ghostscript\\\"\\; version=\\\"`gs --version`\\\" ','bashScript','',NULL,'event_detail',NULL,NULL),(10,NULL,1,'2013-11-15 01:18:36','5c319663-42f6-4a46-b957-f730c5f3ae88','2385486a-35e2-42e4-bae9-3bfa1995dda4','Transcoding maildir to mbox event detail','echo \"/usr/lib/archivematica/transcoder/transcoderScripts/\" \"%fileFullName%\" \"%outputDirectory%%prefix%%fileName%%postfix%.mbox\"','command','',NULL,'event_detail',NULL,NULL),(11,NULL,1,'2013-11-15 01:18:36','77f73d63-7d82-4b61-8dec-6626c3dc224a','307d4e6d-9cfc-414e-8354-f41fe1247e12','Get event detail text for ffmpeg extraction','echo program=\\\"ffmpeg\\\"\\; version=\\\"`ffmpeg 2>&1 | grep --ignore-case \"FFmpeg version\"`\\\"','bashScript','',NULL,'event_detail',NULL,NULL),(12,NULL,1,'2013-11-15 01:18:36','914fe3e5-fa45-47c6-858d-e11bc71f5b76','2385486a-35e2-42e4-bae9-3bfa1995dda4','Get event detail text for 7z extraction','echo program=\\\"7z\\\"\\; version=\\\"`7z | grep Version`\\\"','bashScript','',NULL,'event_detail',NULL,NULL),(13,NULL,1,'2013-11-15 01:18:36','c072c3c8-ba0e-480b-b0ee-2f27c6c0653e','2385486a-35e2-42e4-bae9-3bfa1995dda4','Get event detail text for unrar extraction','echo program=\\\"unrar-nonfree\\\"\\; version=\\\"`unrar-nonfree | grep \'UNRAR\'`\\\"','bashScript','',NULL,'event_detail',NULL,NULL),(14,NULL,1,'2013-11-15 01:18:36','ebe5a085-6039-4c8d-9953-beed5b03c778','18102743-3a25-4510-bf09-976421d5a646','ps2pdf event detail','echo program=\\\"ps2pdf\\\"\\; program=\\\"Ghostscript\\\"\\; version=\\\"`gs --version`\\\" ','bashScript','',NULL,'event_detail',NULL,NULL),(15,NULL,1,'2013-11-15 01:18:36','1628571b-c2cd-4822-afdb-53561400c7c4','8d81cd4f-20ee-4a82-9eca-455699509cd5','Transcoding to jpg thumbnail with convert','convert \"%fileFullName%\" -thumbnail 100x100 -layers merge\n \"%outputDirectory%%postfix%.jpg\"','command','%outputDirectory%%postfix%.jpg','05f1242e-127d-4eec-826c-f89571d0283f','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','0fd7935a-ed0d-4f67-aa25-1b44684f6aca'),(16,NULL,1,'2013-11-15 01:18:36','520f976f-476d-4ec6-be1c-7c448c5c074d','307d4e6d-9cfc-414e-8354-f41fe1247e12','Transcoding to mp3 with ffmpeg','ffmpeg -i \"%fileFullName%\" -ac 2 -ab 192000 \"%outputDirectory%%prefix%%fileName%%postfix%.mp3\"','bashScript','%outputDirectory%%prefix%%fileName%%postfix%.mp3','5a039206-6ac9-4b9a-a75a-2e57f599a482','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','77f73d63-7d82-4b61-8dec-6626c3dc224a'),(17,NULL,1,'2013-11-15 01:18:36','64c450b4-135c-46d1-a9aa-3f9b15671677','06523365-9061-4ac7-a7f5-3e7e5f06ffac','Transcoding to plain svg with inkscape','sudo /usr/bin/inkscape \"%fileFullName%\" --export-plain-svg=\"%outputDirectory%%prefix%%fileName%%postfix%.svg\"\n sudo chmod 777 \"%outputDirectory%%prefix%%fileName%%postfix%.svg\"','bashScript','%outputDirectory%%prefix%%fileName%%postfix%.svg','8ba2101d-3f3c-4620-a0fa-a75cf5f5ec27','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','1db2deea-01dd-43e5-9f27-dc9ed02acdfe'),(18,NULL,1,'2013-11-15 01:18:36','6957fdac-a1ed-470f-89f7-fb00be42ea13','8d81cd4f-20ee-4a82-9eca-455699509cd5','Transcoding to jpg with convert','convert \"%fileFullName%\" -sampling-factor 4:4:4 -quality 60 -layers merge\n \"%outputDirectory%%prefix%%fileName%%postfix%.jpg\"','command','%outputDirectory%%prefix%%fileName%%postfix%.jpg','ffb55e9a-29f1-4276-a9a5-5ef813229b79','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','0fd7935a-ed0d-4f67-aa25-1b44684f6aca'),(19,NULL,1,'2013-11-15 01:18:36','76fd899e-cd5a-4da3-8752-45c43fc18656','307d4e6d-9cfc-414e-8354-f41fe1247e12','Transcoding to mkv with ffmpeg','#!/bin/bash\n\ninputFile=\"%fileFullName%\"\noutputFile=\"%outputDirectory%%prefix%%fileName%%postfix%.mkv\"\naudioCodec=\"pcm_s16le\"\nvideoCodec=\"ffv1\"\n\ncommand=\"ffmpeg -vsync passthrough -i \\\"${inputFile}\\\" -map 0:v -map 0:a \"\ncommand=\"${command} -vcodec ${videoCodec} -g 1 \"\ncommand=\"${command} -acodec ${audioCodec}\"\n\n\ncommand=\"${command} ${outputFile}\"\n\necho $command\neval $command\n','bashScript','%outputDirectory%%prefix%%fileName%%postfix%.mkv','4dc90ad8-319a-46be-95c8-390b189867d9','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','77f73d63-7d82-4b61-8dec-6626c3dc224a'),(20,NULL,1,'2013-11-15 01:18:36','9dc10fcb-5809-4c0b-917a-02517ef4d1c6','307d4e6d-9cfc-414e-8354-f41fe1247e12','Transcoding to wav with ffmpeg','ffmpeg -i \"%fileFullName%\" \"%outputDirectory%%prefix%%fileName%%postfix%.wav\"','bashScript','%outputDirectory%%prefix%%fileName%%postfix%.wav','2edf82d5-f860-44ea-9f5d-852f0097f430','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','77f73d63-7d82-4b61-8dec-6626c3dc224a'),(21,NULL,1,'2013-11-15 01:18:36','a34ddc9b-c922-4bb6-8037-bbe713332175','8d81cd4f-20ee-4a82-9eca-455699509cd5','Transcoding to tif with convert','convert \"%fileFullName%\" +compress \"%outputDirectory%%prefix%%fileName%%postfix%.tif\"','command','%outputDirectory%%prefix%%fileName%%postfix%.tif','2ebdfa17-2257-49f8-8035-5f304bb46918','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','0fd7935a-ed0d-4f67-aa25-1b44684f6aca'),(22,NULL,0,'2013-11-15 01:18:36','a74cbffb-281b-49ee-8e96-fbac2ab54785','18102743-3a25-4510-bf09-976421d5a646','Transcoding to pdf with ps2pdf','ps2pdf \"%fileFullName%\" \"%outputDirectory%%prefix%%fileName%%postfix%.pdf\"','command','%outputDirectory%%prefix%%fileName%%postfix%.pdf',NULL,'normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','ebe5a085-6039-4c8d-9953-beed5b03c778'),(23,NULL,1,'2013-11-15 01:18:36','bb5a6da2-4b89-4f8c-96e3-ca36c55d3337','307d4e6d-9cfc-414e-8354-f41fe1247e12','Transcoding to mp4 with ffmpeg','ffmpeg -i \"%fileFullName%\" -vcodec libx264 -pix_fmt yuv420p -preset medium -crf 18 \"%outputDirectory%%prefix%%fileName%%postfix%.mp4\"','bashScript','%outputDirectory%%prefix%%fileName%%postfix%.mp4','ad7d3eff-23e2-4e5c-afe3-7fa11d6c8024','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','77f73d63-7d82-4b61-8dec-6626c3dc224a'),(24,NULL,1,'2013-11-15 01:18:36','d6a33093-85d5-4088-83e1-b7a774a826bd','ef6c5539-b803-4d26-9e09-a5b984bf0bf5','Transcoding to pdfa with Ghostscript','gs -dPDFA -dBATCH -dNOPAUSE -sDEVICE=pdfwrite -dPDFACompatibilityPolicy=1 -sOutputFile=\"%outputDirectory%%prefix%%fileName%%postfix%.pdf\" \"%fileFullName%\"','command','%outputDirectory%%prefix%%fileName%%postfix%.pdf','48a16e77-c38c-4928-8d01-480fb6def84a','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','45a2f264-37d7-4881-b28c-25d628bf2823'),(25,NULL,1,'2013-11-15 01:18:36','d91f0637-b2f6-4492-ac1b-23c155102a3e','06523365-9061-4ac7-a7f5-3e7e5f06ffac','Transcoding to pdf with inkscape','inkscape -z \"%fileFullName%\" --export-pdf=\"%outputDirectory%%prefix%%fileName%%postfix%.pdf\"','command','%outputDirectory%%prefix%%fileName%%postfix%.pdf','48a16e77-c38c-4928-8d01-480fb6def84a','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','1db2deea-01dd-43e5-9f27-dc9ed02acdfe'),(26,NULL,1,'2013-11-15 01:18:36','e96b787d-57f6-41a4-9693-d0634bfacacb','18102743-3a25-4510-bf09-976421d5a646','Transcoding to pdf with ps2pdf','ps2pdf -dEPSCrop -dPDFA \"%fileFullName%\" \"%outputDirectory%%prefix%%fileName%%postfix%.pdf\"','command','%outputDirectory%%prefix%%fileName%%postfix%.pdf','48a16e77-c38c-4928-8d01-480fb6def84a','normalization','a9111dc0-edc9-47f8-85e5-ad4013971361','ebe5a085-6039-4c8d-9953-beed5b03c778'),(27,NULL,1,'2013-11-15 01:18:36','b8864e2c-87a0-4aec-a8cf-a747a073be28','7d1f8bb1-7915-4b45-a0d5-34e0aab8d6fc','Extracting 7Zip compatible format.','7z x -bd -o\"%outputDirectory%\" \"%inputFile%\"','command','%outputDirectory%',NULL,'Extraction',NULL,'914fe3e5-fa45-47c6-858d-e11bc71f5b76'),(28,NULL,1,'2013-11-15 01:18:36','e1b71449-8822-49ac-9d8a-b7ed6f960ec8','efa8474a-8526-48c3-8279-e5a76bdc0995','Transcoding maildir to mbox','\"/usr/lib/archivematica/transcoder/transcoderScripts/archivematicaMaildirToMbox.py\" \"%fileFullName%\" \"%outputDirectory%%prefix%%fileName%%postfix%.mbox\"','command','%outputDirectory%%prefix%%fileName%%postfix%.mbox','b791c6e4-17f1-4317-961c-d87ea7811132','normalization','ef3ea000-0c3c-4cae-adc2-aa2a6ccbffce','5c319663-42f6-4a46-b957-f730c5f3ae88'),(29,NULL,1,'2013-11-15 01:18:36','a03a3a6d-5695-4800-a16d-edd7143cc438','52621750-1f8f-410d-aa1b-eb0a34103d51','Extracting RAR format.','import os, subprocess, sys\r\n\r\ndef main(output_directory, compressed_file):\r\n    # Note that unrar-free only extracts into the current working directory,\r\n    # hence the os.chdir() here\r\n    try:\r\n        os.chdir(output_directory)\r\n        args = [\'unrar\', \'-x\', compressed_file]\r\n        subprocess.call(args)\r\n    except Exception as e:\r\n        return e\r\n\r\nif __name__ == \'__main__\':\r\n    output_directory = sys.argv[1]\r\n    compressed_file = sys.argv[2]\r\n    exit(main(output_directory, compressed_file))','pythonScript','%outputDirectory%',NULL,'extraction',NULL,'c072c3c8-ba0e-480b-b0ee-2f27c6c0653e'),(30,NULL,1,'2013-11-15 01:18:36','3bd47271-a3fa-4627-be97-9f7f69ddeefd','57864018-63d0-4786-8ce5-55393d3ab5a1','Using default thumbnail','cp -R \"/var/archivematica/sharedDirectory/sharedMicroServiceTasksConfigs/transcoder/defaultIcons/default.jpg\" \"%outputDirectory%%postfix%.jpg\"','command','%outputDirectory%%postfix%.jpg','ffb55e9a-29f1-4276-a9a5-5ef813229b79','normalization','ef3ea000-0c3c-4cae-adc2-aa2a6ccbffce',NULL),(31,NULL,1,'2013-11-15 01:18:36','41112047-7ddf-4bf0-9156-39fe96b32d53','57864018-63d0-4786-8ce5-55393d3ab5a1','Copying file to access directory','cp -R \"%inputFile%\" \"%outputDirectory%%prefix%%fileName%%postfix%%fileExtensionWithDot%\"','command','%outputDirectory%%prefix%%fileName%%postfix%%fileExtensionWithDot%','0ab4cd40-90e7-4d75-b294-498177b3897d','normalization','ef3ea000-0c3c-4cae-adc2-aa2a6ccbffce',NULL),(32,'6537147f-4dd4-4950-8aff-5578db9a485d',1,'2014-05-30 23:16:54','183f6d5f-3a8e-4e5a-a6bc-948b9bfca176','c5465b07-8dc7-475e-a5c9-ccb2ba2ed083','FITS','fits.sh -i %relativeLocation%','command',NULL,'d60e5243-692e-4af7-90cd-40c53cb8dc7d','characterization',NULL,NULL),(33,NULL,1,'2014-07-11 23:29:17','80314f3c-5d48-4ad1-a9f2-2c0f7c7b229d','467a5875-f9ef-49ac-ac93-29f4bac3dbae','FFprobe','ffprobe -i \"%fileFullName%\" -show_data -show_format -show_error -show_streams -show_chapters -show_private_data -show_versions -print_format xml','bashScript',NULL,'d60e5243-692e